import React, {useState} from 'react';

class Input extends React.Component{
    constructor(props){
        super(props);
        this.temperature = props.temperature;
        this.unit = props.temperature
    }

    render(){
        return (
            <div>
                <input value={this.temperature}></input>
                <div>
                    {this.temperature}
                </div>
            </div>
        );
    }
}

export default Input;
